INSERT INTO COUNTRY (country_code, name, region, income_group, special_notes) VALUES ('MNE', 'Montenegro', 'Europe & Central Asia', 'Upper middle income', 'Montenegro declared independence from Serbia and Montenegro on June 3, 2006. Where available, data for each country are shown separately. However, for Serbia, some indicators continue to include data for Montenegro through 2005.');
