INSERT INTO COUNTRY (country_code, name, region, income_group, special_notes) VALUES ('SVK', 'Slovak Republic', 'Europe & Central Asia', 'High income', 'A simple multiplier is used to convert the national currencies of EMU members to euros. The following irrevocable euro conversion rate entered into force on January 1, 2009: 1 euro = 30.126 Slovak koruna. Please note that historical data are not actual euros and are not comparable or suitable for aggregation across countries.');
